import React from "react";
import Data from "./Data";

const Card = () => {
  return (
    <>
      <div>
        {Data.map((elem) => {
          let { id, title, desc, imgUrl } = elem;
          return (
            <>
            <div className="cards">

              
            </div>
              <div className="container col-3 m">
                <h1 > {id}</h1>
                <h1> {title}</h1>
                <img src={imgUrl} alt="" />
                <h4>{desc}</h4>
              </div>
            </>
          );
        })}
      </div>
    </>
  );
};

export default Card;
